import React from "react";
import { Menu, Segment, Container, Grid } from "semantic-ui-react";

export default () => {
  return (
    <div style={{ position: "" }}>
      <Segment
        inverted
        style={{
          margin: "5em 0em 0em",
          padding: "5em 0em",
          position: "absolute",
          width: "100%",
          bottom: "0px",
        }}
        vertical
      >
        <Container>
          <Grid columns={4} stackable inverted divided>
            <Grid.Row></Grid.Row>
          </Grid>
        </Container>
      </Segment>
    </div>
  );
};
